"use strict";

angular.module("Mukijs", []);

angular.module("Mukijs").controller("MukiCtrl", function($scope, Ask) {
    $scope.q = [];
    $scope.qlength = 0;
    console.log("ng run");
    Ask.get().then(function(results) {
        $scope.q = results.data;
        $scope.qlength = results.data.length;
    });
});

"use strict";

angular.module("Mukijs").factory("Ask", function($q, $http) {
    function get() {
        return $http.get("data/data.ask.json");
    }
    return {
        get: get
    };
});
